import React from 'react';



const ShopCategory = () => {
  
  const products = [
    { id: 1, name: 'Продукт 1', price: '100 руб.' },
    { id: 2, name: 'Продукт 2', price: '200 руб.' },
    { id: 3, name: 'Продукт 3', price: '300 руб.' },
    { id: 4, name: 'Продукт 4', price: '400 руб.' },
    { id: 5, name: 'Продукт 5', price: '500 руб.' },
    { id: 6, name: 'Продукт 6', price: '600 руб.' },
    { id: 7, name: 'Продукт 7', price: '700 руб.' },
    { id: 8, name: 'Продукт 8', price: '800 руб.' },
    { id: 9, name: 'Продукт 9', price: '900 руб.' },
    { id: 10, name: 'Продукт 10', price: '1000 руб.' },
  ];нн
  
  return (
    <div>
      <h2>Наши товары</h2>
      <ul>
        {products.map((product) => (
          <li key={product.id}>
            <h3>{product.name}</h3>
            <p>{product.price}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ShopCategory;
